import React from "react";
import { Wrap, FlexItem, FlexItems } from "../styles/How";
import { Title } from "../styles/About";

function How() {
  return (
    <Wrap>
        <Title>How We Work</Title>
      <div className="container">
        <FlexItems>
          <FlexItem>1</FlexItem>
          <FlexItem>2</FlexItem>
          <FlexItem>3</FlexItem>
        </FlexItems>
      </div>
    </Wrap>
  );
}

export default How;
